import React, { FunctionComponent, useState } from 'react';
import DragonBall from './models/dragonball'
import DRAGONBALLS from './models/mock-dragonball'

const App: FunctionComponent = () => {
    const [dragonballzzz] = useState<DragonBall>(DRAGONBALLS);

    return (
        <div>
            <h1>Dragon Ball Z</h1>
            <h1>Il y a {dragonballzz.length} personnages dragon ball dans votre liste</h1>
        </div>
    )
}

export default App;
